import React, { Component } from 'react';

const initialState = {
  name: "",
  email: "",
  id: "",
  address: "",
  contact: "",
  isSubmitted: true,
  error: {},
  holaboi: ""
};

export class add_student extends Component {
         state = initialState;
         takeValueFromInput = e => {
           this.setState({
             [e.target.name]: e.target.value
           });
         };

         holaOnSubmit = e => {
           e.preventDefault();
           let { name, email, id, address,contact } = this.state;
           this.props.register(
             { name, email, id, address, contact },
             this.props.history
           );
         };
         render() {
               let { name, email, id, address, contact,error } = this.state;
           return (
             <div className="container">
               <div className="row">
                 <div className="col-md-8 offset-md-2">
                   <h1 className="text-center">Student Registration Form</h1>
                   {this.state.holaboi && (
                     <p className="text-success">{this.state.holaboi}</p>
                   )}
                   <form ref={this.myForm} onSubmit={this.holaOnSubmit}>
                     <table>
                       <tr>
                         <td>
                           <label style={{ marginLeft: "60px" }} htmlFor="id">
                             <b>ID no:</b>{" "}
                           </label>
                         </td>
                         <td>
                           <input
                             type="text"
                             className={
                               error.name
                                 ? "form-control is-invalid"
                                 : "form-control"
                             }
                             name="id"
                             id="id"
                             value={name}
                             onChange={this.takeValueFromInput}
                           />
                           <br />
                           {error.id && (
                             <div className="invalid-feedback">{error.id}</div>
                           )}
                         </td>
                       </tr>
                       <tr>
                         <td>
                           <label style={{ marginLeft: "60px" }} htmlFor="id">
                             <b>Name:</b>{" "}
                           </label>
                         </td>
                         <td>
                           <input
                             type="text"
                             className={
                               error.name
                                 ? "form-control is-invalid"
                                 : "form-control"
                             }
                             name="name"
                             id="name"
                             value={name}
                             onChange={this.takeValueFromInput}
                           />{" "}
                           <br />
                           {error.name && (
                             <div className="invalid-feedback">
                               {error.name}
                             </div>
                           )}
                         </td>
                       </tr>
                       <tr>
                         <td>
                           <label style={{ marginLeft: "60px" }} htmlFor="id">
                             <b>Email:</b>{" "}
                           </label>
                         </td>
                         <td>
                           <input
                             type="email"
                             className={
                               error.email
                                 ? "form-control is-invalid"
                                 : "form-control"
                             }
                             name="email"
                             id="email"
                             value={email}
                             onChange={this.takeValueFromInput}
                           />{" "}
                           <br />
                           {error.email && (
                             <div className="invalid-feedback">
                               {error.email}
                             </div>
                           )}
                         </td>
                       </tr>
                       <tr>
                         <td>
                           <label htmlFor="contact">Contact Number</label>
                         </td>
                         <td>
                           <input
                             type="text"
                             className={
                               error.contact
                                 ? "form-control is-invalid"
                                 : "form-control"
                             }
                             name="contact"
                             id="contact"
                             value={contact}
                             onChange={this.takeValueFromInput}
                           />{" "}
                           <br />
                           {error.contact && (
                             <div className="invalid-feedback">
                               {error.contact}
                             </div>
                           )}
                         </td>
                       </tr>
                       <tr>
                         <td></td>
                         <td>
                           <button className="btn btn-sm btn-outline-info float-right">
                             Registration
                           </button>
                         </td>
                       </tr>
                     </table>
                   </form>
                 </div>
               </div>
             </div>
           );
         }
       }

export default add_student;
